  false,\n\t\"url\": null,\n\t\"notes\": \"The 2015 TIGER Geodatabases are extracts
  of selected nation based and state based geographic and cartographic information
  from then                    U.S. Census Bureau's Master Address File/Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) database. The geodatabasesn
  \                   include feature class layers of information for the fifty states,
  the District of Columbia, Puerto Rico, and the Island areas (American Samoa, the
  n                    Commonwealth of the Northern Mariana Islands, Guam, and the
  United States Virgin Islands). The geodatabases do not contain any sensitive data.
  The n                    2015 TIGER Geodatabases are designed for use with Esriu00e2u0080u0099s
  ArcGIS.n                    n                    The Areal Hydrography National
  Geodatabase contains areal hydrography, or water features, for the nation. This
  includes ponds, lakes, oceans, swampsn                    (up to the U.S. nautical
  three-mile limit), glaciers, and the area covered by large rivers, streams, and/or
  canals that are represented asn                    double-line drainage\",\n\t\"license_title\":
